/**
 Given a string s, find the length of the longest substring without repeating characters.
 */

import XCTest

/*
 Initial Plan:
  - Trace along the string checking if the next character is already in the existing string
    - If it is, add it and continue
    - If its not, move the solution up to it's last instance and continue
 Improvements to be made on this method:
  - Method is O(n), I don't think I can improve
 */

func lengthOfLongestSubstring(_ s: String) -> Int {
    var currentMax = 0
    var currentString = ""

    for currentCharacter in s {
        if !currentString.contains(currentCharacter) {
            currentString.append(currentCharacter)

            if currentString.count > currentMax {
                currentMax = currentString.count
            }
        } else {
            currentString = String(currentString[currentString.index(currentString.startIndex, offsetBy: currentString.distance(from: currentString.startIndex, to: currentString.firstIndex(of: currentCharacter)!) + 1) ..< currentString.endIndex])
            currentString.append(currentCharacter)
        }
    }

    return currentMax
}

